import React from "react";
import PDFViewer from "pdf-viewer-reactjs";

import resume from "../../public/resume.pdf";

export default function Resume() {
  return (
    <div>
      <PDFViewer
        document={{
          resume
        }}
      />
    </div>
  );
}
